import React, { Component } from 'react'

import {observable,action} from 'mobx'
import {Observer} from 'mobx-react'

class Store{
    @observable count=0
    @action increment(){
        console.log(this.count)
        this.count++
    }
}

const count = observable({
    count: 0,
    increment:count++
})


